import React, { Component } from "react";
// import { Link } from "react-router-dom";
import { health as healthCheck } from "./../../Services/api";

class List extends Component {
  constructor() {
    super();
    this.state = {
      serverChecking: true,
      serverHealthy: false,
      questions: [],
      name: "becca"
    };
  }

  async componentDidMount() {
    try {
      const health = await healthCheck();
      console.log(health);
      if (health.status === "OK") {
        this.setState({
          serverChecking: false,
          serverHealthy: true
        });
      } else {
        this.setState({
          serverCheck: false
        });
      }
    } catch (error) {
      console.log(error);
      console.log("Error in service.");
    }
  }

  render() {
    console.log(this.state.serverChecking)
    console.log(this.state.serverHealthy)

    return (
      <div className="App">
        <h1>list</h1>
        {this.state.serverChecking && <p>checking server health</p>}
        {this.state.serverHealthy && <p>server is healthy</p>}
      </div>
    );
  }
}

export default List;
